import React from 'react'
import './join.css';
import logo from "../../images/logo.png";
const Join = () => {
  return (
    <div className='JoinPage'>
      <div className='JoinContainer'>
        <img src={log} alt=""/>
        <h1>c chat</h1>
      </div>
    </div>
  )
}

export default Join
